module.exports = '<ul class="nav nav-list digger-html">\n  <li ng-repeat="row in tree_rows | filter:{visible:true} track by row.branch._id" ng-animate="\'abn-tree-animate\'" ng-class="\'level-\' + {{ row.level }} + (row.branch._id == selectedid ? \' active\':\'\')" class="abn-tree-row"><a ng-click="user_clicks_branch(row.branch)"><i ng-class="row.tree_icon" ng-click="togglebranch(row.branch)" class="indented tree-icon"> </i><span class="indented tree-label">\n  		\n	    <span class="code" ng-class="{selected:(row.branch._data.selected?true:false)}">\n	    	<!--\n		    	tag\n		     -->\n		    &lt;<span class="diggertag" ng-class="{highlighted:(row.branch._data.highlighted==\'tag\')}">{{ row.branch._digger.tag }}</span> \n		    <!--\n		    	id\n		     -->\n		    <span ng-show="row.branch._digger.id">id="<span class="diggerid" ng-class="{highlighted:(row.branch._data.highlighted==\'id\')}">{{ row.branch._digger.id }}</span>"</span>\n		    <!--\n		    	class\n		     -->\n		    <span ng-show="row.branch._classst">class="<span class="diggerclass" ng-class="{highlighted:(row.branch._data.highlighted==\'class\')}">{{ row.branch._classst }}</span>"</span>\n\n		    <!--\n		    	attributes\n		    -->\n		    <span ng-show="row.branch._data.showattributes">\n		    	<span ng-repeat="attr in row.branch._data._display_attrs">{{attr.title}}="<span ng-class="{highlighted:(row.branch._data.highlighted==\'attr\')}" class="diggerattr">{{ attr.value }}</span>" </span>\n		    </span>\n\n		    <span ng-hide="row.branch._data.showattributes">\n		    	name="{{ row.branch.title || row.branch.name }}" \n		    </span>\n\n		    <span ng-show="row.branch._children.length<=0"> /</span>&gt;\n	  	</span>\n  </span></a></li>\n</ul>';